import "./App.css";
import axios from "axios";
import React, { useEffect, useState } from "react";
import Button from "./UI/Button";
import Card from "./UI/Card";

function App() {
  const [vehicles, setVehicles] = useState([]);

  const getVehicles = async () => {
    const { data } = await axios("/vehicles/list");
    console.log(data);
    setVehicles(data);
  };
  const occupyVehicle = () => {
    console.log("occupy Vehicle");
    // axios.get(`https://jsonplaceholder.typicode.com/users`)
    // .then(res => {
    //   const persons = res.data;
    //   this.setState({ persons });
    // })
  };
  const releaseVehicle = () => {
    console.log("release Vehicle");
    // axios.get()
  };

  const renderVehicles = (_vehicles) => {
    return _vehicles.map((v) => {
      return (
        <div className="vehicles-wrapper">
          <Card>
            <p>manufacturer: {v.manufacturer}</p>
            <p>license plate number: {v.license_plate_number}</p>
            <p>
              {/* is available:  */}
              <div className="buttons-wrapper">
                {console.log("pppp", v.is_available, v.manufacturer)}
                {console.log("pppp")}
                {/* if available=true  Occupy button will showen  */}
                {/* if available=false && user is owner - Release will showen */}
                <div>

                <Button
                  className={
                    "button " + (v.is_available ? "available" : "not-available")
                  }
                  onClick={occupyVehicle}
                  >
                  Occupy
                </Button>
                {!v.is_available && <span className="not-available-text">Vehicle is not available</span>}

                  </div>
                <Button
                className={
                  "button " +
                  (v.is_available  ? "available-and-owner" : "")
                }
                onClick={releaseVehicle}
                >
                Release
              </Button>
              </div>
            </p>
          </Card>
        </div>
      );
    });
  };

  useEffect(() => {
    getVehicles();
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <h2>Vehicles list </h2>
      </header>
      {renderVehicles(vehicles)}
    </div>
  );
}

export default App;
